  const [newnote,setNewNote] = useState()
  return (
    <div>
      <h1>Notes</h1>
      <ol>
        {notes.map((note)=>(
          <Note key={note.id} {...note} />
        ))}
      </ol>
      <div>
        <input type='text'/>
        <button>Crear nota</button>
        </div>
    </div>
  )
}
